-	парцела број 334, број дела 1, земљиште под зградом и другим објектом, површине 286 м2; број дела 2, земљиште под зградом и другим објектом, површине 11 м2; број дела 3, земљиште под зградом и другим објектом, површине 226 м2; број дела 4, земљиште уз зграду и други објекат, површине 295 м2.

