     - Кат. парцела бр. 1441 КО Сурдулица, уписана у Листу непокретности бр. 1176, право коришћења са делом поседа од ½ (једне идеалне половине), укупне површине 945 м2, од чега је:

        - земљиште под зградом и другим објектом, површине 97 м2;
